import React from "react";
import { Form, Button } from "react-bootstrap";
import "./LoginForm.css";

const LoginForm = () => {
  const loginFormHandler = (e) => {
    e.preventDefault()
  }
  return (
    <div className="loginContainer">
      <div className="box">
        <div className="loginForm">
        <h3>Login</h3>
        <Form action="/login" onSubmit={loginFormHandler}>
          <Form.Group className="mb-3" controlId="formBasicEmail">
            <Form.Label>Email address</Form.Label>
            <Form.Control type="email" placeholder="Enter email"  value={inputEmail} onInput={e => setInputEmail(e.target.value)}/>
            <Form.Text className="text-muted">
              We'll never share your email with anyone else.
            </Form.Text>
          </Form.Group>
          <Form.Group className="mb-3" controlId="formBasicPassword">
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" placeholder="Password" value={inputEmail} onInput={e => setInputEmail(e.target.value)}/>
          </Form.Group>
          <Form.Group className="mb-3" style={{'float':'right'}} controlId="formBasicCheckbox">
            <Form.Check type="checkbox" label="Remember me" />
          </Form.Group>
          <Button variant="primary" type="submit">
            Login
          </Button>
        </Form>
        </div>
      </div>
    </div>
  );
};

export default LoginForm;
